let defaultState = {
  users: {}
};
const getUsersReducer = (state = defaultState, action) => {
  if (action.type === "GET_USERS") {
    return {
      ...state,
      users: action.users
    };
  } else {
    return {
      ...state
    };
  }
};
export default getUsersReducer;
